import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Sidebar from './components/Sidebar';
import Dashboard from './components/Dashboard';
import ProjectView from './components/ProjectView';
import EmployeeManagement from './components/EmployeeManagement';
import StatisticsManagement from './components/StatisticsManagement';
import CommuteView from './components/CommuteView';

function App() {
  return (
    <Router>
      <div className="wrap_inner border-top--main flex">
        <Sidebar />
        <Routes>
          <Route path="/" element={<Dashboard />} />
          <Route path="/project-view" element={<ProjectView />} />
          {/* <Route path="/employee-management" element={<EmployeeManagement />} /> */}
          {/* <Route path="/statistics-management" element={<StatisticsManagement />} /> */}
          {/* <Route path="/commute-view" element={<CommuteView />} /> */}
        </Routes>
      </div>
    </Router>
  );
}

export default App;
